Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...или так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Перейдите <a href=\"https://doveriemsk.ru/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!</p>\n<!-- /wp:paragraph -->','Главная страница','','inherit','closed','closed','','2-revision-v1','','','2024-02-24 22:49:39','2024-02-24 19:49:39','',2,'https://doveriemsk.ru/?p=12',0,'revision','',0),(13,1,'2024-02-24 22:50:35','2024-02-24 19:50:35','','Главная страница','','inherit','closed','closed','','2-revision-v1','','','2024-02-24 22:50:35','2024-02-24 19:50:35','',2,'https://doveriemsk.ru/?p=13',0,'revision','',0),(14,1,'2024-02-24 22:54:22','2024-02-24 19:54:22','','Главная страница','','inherit','closed','closed','','2-revision-v1','','','2024-02-24 22:54:22','2024-02-24 19:54:22','',2,'https://doveriemsk.ru/?p=14',0,'revision','',0),(15,1,'2024-02-24 22:58:30','2024-02-24 19:58:30','a:11:{s:10:\"aria-label\";s:0:\"\";s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:35:\"не более 30 символов\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:9:\"maxlength\";i:30;s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";}','Верхний заголовок','top_title','publish','closed','closed','','field_65da4a2f49de2','','','2024-02-24 22:58:30','2024-02-24 19:58:30','',9,'https://doveriemsk.ru/?post_type=acf-field&p=15',1,'acf-field','',0),(16,1,'2024-02-24 22:58:58','2024-02-24 19:58:58','','Главная страница','','inherit','closed','closed','','2-revision-v1','','','2024-02-24 22:58:58','2024-02-24 19:58:58','',2,'https://doveriemsk.ru/?p=16',0,'revision','',0),(17,1,'2024-02-25 16:29:50','2024-02-25 13:29:50','a:8:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:13:\"post_category\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:17:\"category:partners\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";s:12:\"show_in_rest\";i:0;}','Партнеры','partnery','publish','closed','closed','','group_65db408baa0fa','','','2024-02-25 16:29:50','2024-02-25 13:29:50','',0,'https://doveriemsk.ru/?post_type=acf-field-group&#038;p=17',0,'acf-field-group','',0),(18,1,'2024-02-25 16:29:50','2024-02-25 13:29:50','a:11:{s:10:\"aria-label\";s:0:\"\";s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:9:\"maxlength\";i:100;s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";}','Город или регион','city','publish','closed','closed','','field_65db408b850ea','','','2024-02-25 16:29:50','2024-02-25 13:29:50','',17,'https://doveriemsk.ru/?post_type=acf-field&p=18',0,'acf-field','',0),(20,1,'2024-02-25 16:33:18','2024-02-25 13:33:18','<!-- wp:paragraph -->\n<p>Оказывать стационарную помощь больница начала в 1866 году в бывшей усадьбе Баташева после переустройства, проведённого архитектором А. А. Мейнгардом.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Превращением дворца в лечебное учреждение занимался главный врач Н.А. Берензон. Под его началом Яузская больница стала выдающейся московской клиникой.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Отделения больницы:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Гинекологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиологическое отделение для больных инфарктом миокарда</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиореанимация</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Клинико-диагностическая лаборатория</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Консультативно-диагностический центр</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Неврологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение анестезиологии и реанимации</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение анестезиологии-реанимации кардиохирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение гнойной хирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение для больных с острым нарушением мозгового кровообращения</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение кардиохирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение лазерной и витреоретинальной микрохирургии глаза</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение лучевых и функциональных исследований</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение по рентгенэндоваскулярной диагностике и лечению</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение ранней медицинской реабилитации</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение реанимации и интенсивной терапии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение хирургического лечения сложных нарушений ритма сердца и электрокардиостимуляции (ОНР)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Пульмонологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Терапевтическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Торакальное хирургическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Хирургическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр головокружений</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр клинических исследований</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр персонализированной медицины</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Эндоскопическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>\n</code></pre>\n<!-- /wp:code -->','Городская клиническая больница имени И.В. Давыдовского','','publish','open','open','','gorodskaya-klinicheskaya-bolnicza-imeni-i-v-davydovskogo','','','2024-02-25 16:52:05','2024-02-25 13:52:05','',0,'https://doveriemsk.ru/?p=20',0,'post','',0),(21,1,'2024-02-25 16:32:11','2024-02-25 13:32:11','','partner1','','inherit','open','closed','','partner1','','','2024-02-25 16:32:30','2024-02-25 13:32:30','',20,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner1.jpg',0,'attachment','image/jpeg',0),(22,1,'2024-02-25 16:33:18','2024-02-25 13:33:18','<!-- wp:paragraph -->\n<p>Оказывать стационарную помощь больница начала в 1866 году в бывшей усадьбе Баташева после переустройства, проведённого архитектором А. А. Мейнгардом.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Превращением дворца в лечебное учреждение занимался главный врач Н.А. Берензон. Под его началом Яузская больница стала выдающейся московской клиникой.</p>\n<!-- /wp:paragraph -->','Городская клиническая больница имени И.В. Давыдовского','','inherit','closed','closed','','20-revision-v1','','','2024-02-25 16:33:18','2024-02-25 13:33:18','',20,'https://doveriemsk.ru/?p=22',0,'revision','',0),(23,1,'2024-02-25 16:35:01','2024-02-25 13:35:01','<!-- wp:paragraph -->\n<p>Эта клиника располагается в историческом месте на Нагорной улице, где еще в начале ХIX века существовала лечебница, открытая видным российским государственным деятелем, благотворителем и меценатом Борисом Николаевичем Юсуповым.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Новая Юсуповская больница — четырехэтажное отдельно стоящее здание с полным комплексом современного оснащения.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Сегодня Юсуповская больница призвана продолжить славные традиции отечественной медицины.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В структуру больницы также входят: поликлиническое отделение, комфортный стационар, отделение реанимации и интенсивной терапии, диагностический центр, хирургическое отделение, в котором есть ангиографическая операционная, кабинет компьютерной томографии.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В Юсуповской больнице проводится регулярная научная деятельность. Мы сотрудничаем с научно-практическими центрами, направленными на комплексное решение проблем пациентов.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Лечение в клинике отличается рядом особенностей:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>полный цикл медицинских услуг: профилактика, амбулаторно-поликлиническое обслуживание, диагностика, стационарное лечение и реабилитация;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>полный спектр медицинских препаратов, зарегистрированных в РФ (любые химиопрепараты, антибиотики и др.), сотрудничество с лучшими НИИ в сфере сложных и редких анализов, переливание крови и использование наркотических сильнодействующих веществ;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>постоянно обновляемая медицинская аппаратура известных производителей Японии, Германии, Италии и др.;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>диагностические процедуры любой сложности (от базовой лабораторной и лучевой диагностики до ПЭТ, иммуноферментных, фармакогенетических анализов, генетических анализов опухолей и др).</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Основные направления деятельности Юсуповской больницы</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Неврология</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Онкология</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Реабилитация</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Хирургия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Терапия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Травматология и ортопедия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр женского здоровья</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр лечения мигрени</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр кардиологии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Диагностика</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Юсуповская больница','','publish','open','open','','yusupovskaya-bolnicza','','','2024-02-25 16:38:56','2024-02-25 13:38:56','',0,'https://doveriemsk.ru/?p=23',0,'post','',0),(24,1,'2024-02-25 16:34:40','2024-02-25 13:34:40','','partner2','','inherit','open','closed','','partner2','','','2024-02-25 16:34:56','2024-02-25 13:34:56','',23,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner2.jpg',0,'attachment','image/jpeg',0),(25,1,'2024-02-25 16:35:01','2024-02-25 13:35:01','<!-- wp:paragraph -->\n<p>Эта клиника располагается в историческом месте на Нагорной улице, где еще в начале ХIX века существовала лечебница, открытая видным российским государственным деятелем, благотворителем и меценатом Борисом Николаевичем Юсуповым.</p>\n<!-- /wp:paragraph -->','Юсуповская больница','','inherit','closed','closed','','23-revision-v1','','','2024-02-25 16:35:01','2024-02-25 13:35:01','',23,'https://doveriemsk.ru/?p=25',0,'revision','',0),(26,1,'2024-02-25 16:36:49','2024-02-25 13:36:49','<!-- wp:paragraph -->\n<p>Своевременная реабилитация пенсионеров после серьезных заболеваний поможет предотвратить рецидивы и вернуться к прежней самостоятельности. Необратимые болезни также поддаются терапии при грамотном комплексном подходе для смягчения симптомов и продления качественной жизни.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Для постояльцев подготовлены комфортабельные комнаты. Каждая из них оборудована мебелью, телевизором, санузлом. Есть отдельные палаты с функциональными кроватями для людей с ограниченными возможностями здоровья.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Каждый подопечный получает:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>сбалансированное питание;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>круглосуточный уход;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>психологическую поддержку;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>разнообразный досуг.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Сеть пансионатов для пожилых  «БЛИЗКИЕ ЛЮДИ»','','publish','open','open','','set-pansionatov-dlya-pozhilyh-blizkie-lyudi','','','2024-02-25 16:52:27','2024-02-25 13:52:27','',0,'https://doveriemsk.ru/?p=26',0,'post','',0),(27,1,'2024-02-25 16:35:58','2024-02-25 13:35:58','','partner3','','inherit','open','closed','','partner3','','','2024-02-25 16:36:06','2024-02-25 13:36:06','',26,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner3.jpg',0,'attachment','image/jpeg',0),(28,1,'2024-02-25 16:36:49','2024-02-25 13:36:49','<!-- wp:paragraph -->\n<p>Своевременная реабилитация пенсионеров после серьезных заболеваний поможет предотвратить рецидивы и вернуться к прежней самостоятельности. Необратимые болезни также поддаются терапии при грамотном комплексном подходе для смягчения симптомов и продления качественной жизни.</p>\n<!-- /wp:paragraph -->','Сеть пансионатов для пожилых  «БЛИЗКИЕ ЛЮДИ»','','inherit','closed','closed','','26-revision-v1','','','2024-02-25 16:36:49','2024-02-25 13:36:49','',26,'https://doveriemsk.ru/?p=28',0,'revision','',0),(30,1,'2024-02-25 16:38:54','2024-02-25 13:38:54','<!-- wp:paragraph -->\n<p>Эта клиника располагается в историческом месте на Нагорной улице, где еще в начале ХIX века существовала лечебница, открытая видным российским государственным деятелем, благотворителем и меценатом Борисом Николаевичем Юсуповым.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Новая Юсуповская больница — четырехэтажное отдельно стоящее здание с полным комплексом современного оснащения.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Сегодня Юсуповская больница призвана продолжить славные традиции отечественной медицины.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В структуру больницы также входят: поликлиническое отделение, комфортный стационар, отделение реанимации и интенсивной терапии, диагностический центр, хирургическое отделение, в котором есть ангиографическая операционная, кабинет компьютерной томографии.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В Юсуповской больнице проводится регулярная научная деятельность. Мы сотрудничаем с научно-практическими центрами, направленными на комплексное решение проблем пациентов.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Лечение в клинике отличается рядом особенностей:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>полный цикл медицинских услуг: профилактика, амбулаторно-поликлиническое обслуживание, диагностика, стационарное лечение и реабилитация;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>полный спектр медицинских препаратов, зарегистрированных в РФ (любые химиопрепараты, антибиотики и др.), сотрудничество с лучшими НИИ в сфере сложных и редких анализов, переливание крови и использование наркотических сильнодействующих веществ;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>постоянно обновляемая медицинская аппаратура известных производителей Японии, Германии, Италии и др.;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>диагностические процедуры любой сложности (от базовой лабораторной и лучевой диагностики до ПЭТ, иммуноферментных, фармакогенетических анализов, генетических анализов опухолей и др).</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Основные направления деятельности Юсуповской больницы</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Неврология</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Онкология</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Реабилитация</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Хирургия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Терапия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Травматология и ортопедия</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр женского здоровья</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр лечения мигрени</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр кардиологии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Диагностика</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Юсуповская больница','','inherit','closed','closed','','23-revision-v1','','','2024-02-25 16:38:54','2024-02-25 13:38:54','',23,'https://doveriemsk.ru/?p=30',0,'revision','',0),(32,1,'2024-02-25 16:46:09','2024-02-25 13:46:09','<!-- wp:paragraph -->\n<p>Оказывать стационарную помощь больница начала в 1866 году в бывшей усадьбе Баташева после переустройства, проведённого архитектором А. А. Мейнгардом.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Превращением дворца в лечебное учреждение занимался главный врач Н.А. Берензон. Под его началом Яузская больница стала выдающейся московской клиникой.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>\n</code></pre>\n<!-- /wp:code -->','Городская клиническая больница имени И.В. Давыдовского','','inherit','closed','closed','','20-revision-v1','','','2024-02-25 16:46:09','2024-02-25 13:46:09','',20,'https://doveriemsk.ru/?p=32',0,'revision','',0),(34,1,'2024-02-25 16:49:49','2024-02-25 13:49:49','<!-- wp:paragraph -->\n<p>Оказывать стационарную помощь больница начала в 1866 году в бывшей усадьбе Баташева после переустройства, проведённого архитектором А. А. Мейнгардом.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Превращением дворца в лечебное учреждение занимался главный врач Н.А. Берензон. Под его началом Яузская больница стала выдающейся московской клиникой.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Отделения больницы:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Гинекологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиологическое отделение для больных инфарктом миокарда</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Кардиореанимация</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Клинико-диагностическая лаборатория</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Консультативно-диагностический центр</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Неврологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение анестезиологии и реанимации</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение анестезиологии-реанимации кардиохирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение гнойной хирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение для больных с острым нарушением мозгового кровообращения</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение кардиохирургии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение лазерной и витреоретинальной микрохирургии глаза</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение лучевых и функциональных исследований</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение по рентгенэндоваскулярной диагностике и лечению</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение ранней медицинской реабилитации</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение реанимации и интенсивной терапии</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Отделение хирургического лечения сложных нарушений ритма сердца и электрокардиостимуляции (ОНР)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Пульмонологическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Терапевтическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Торакальное хирургическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Хирургическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр головокружений</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр клинических исследований</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Центр персонализированной медицины</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Эндоскопическое отделение</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>\n</code></pre>\n<!-- /wp:code -->','Городская клиническая больница имени И.В. Давыдовского','','inherit','closed','closed','','20-revision-v1','','','2024-02-25 16:49:49','2024-02-25 13:49:49','',20,'https://doveriemsk.ru/?p=34',0,'revision','',0),(35,1,'2024-02-25 16:52:26','2024-02-25 13:52:26','<!-- wp:paragraph -->\n<p>Своевременная реабилитация пенсионеров после серьезных заболеваний поможет предотвратить рецидивы и вернуться к прежней самостоятельности. Необратимые болезни также поддаются терапии при грамотном комплексном подходе для смягчения симптомов и продления качественной жизни.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Для постояльцев подготовлены комфортабельные комнаты. Каждая из них оборудована мебелью, телевизором, санузлом. Есть отдельные палаты с функциональными кроватями для людей с ограниченными возможностями здоровья.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Каждый подопечный получает:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>сбалансированное питание;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>круглосуточный уход;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>психологическую поддержку;</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>разнообразный досуг.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Сеть пансионатов для пожилых  «БЛИЗКИЕ ЛЮДИ»','','inherit','closed','closed','','26-revision-v1','','','2024-02-25 16:52:26','2024-02-25 13:52:26','',26,'https://doveriemsk.ru/?p=35',0,'revision','',0),(36,1,'2024-02-25 16:58:59','2024-02-25 13:58:59','<!-- wp:paragraph -->\n<p>Группа компаний МЕДСИ&nbsp;– это ведущая федеральная сеть частных клиник. В&nbsp;центрах компетенций осуществляется качественная диагностика на&nbsp;экспертном оборудовании, проводятся амбулаторные приемы. Специалисты МЕДСИ выполняют сложнейшие операции и&nbsp;обеспечивают реабилитацию.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В&nbsp;клиниках в&nbsp;Москве, Московской области и&nbsp;регионах, медицинском велнесе и&nbsp;в&nbsp;службе помощи на&nbsp;дому работают высококвалифицированные специалисты, в&nbsp;том числе кандидаты и&nbsp;доктора медицинских наук.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Медицина компетенций МЕДСИ гармонично сочетает опыт и&nbsp;авторские методики с&nbsp;достижениями науки, инновационными технологиями и&nbsp;высоким потенциалом оборудования. Наши пациенты получают высококачественную медицинскую помощь, соответствующую мировым стандартам, и&nbsp;безупречный уровень сервиса.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Мы&nbsp;обеспечили удобный график работы центров компетенций, отсутствие очередей и&nbsp;внимательное, индивидуальное отношение персонала. МЕДСИ формирует ответственное отношение к&nbsp;здоровью, новые традиции обслуживания и&nbsp;единое национальное&nbsp;бизнес-пространство&nbsp;в&nbsp;сфере медицины.</p>\n<!-- /wp:paragraph -->','Сеть клиник МЕДСИ','','publish','open','open','','set-klinik-medsi','','','2024-02-25 16:59:02','2024-02-25 13:59:02','',0,'https://doveriemsk.ru/?p=36',0,'post','',0),(37,1,'2024-02-25 16:58:33','2024-02-25 13:58:33','','partner4','','inherit','open','closed','','partner4','','','2024-02-25 16:58:53','2024-02-25 13:58:53','',36,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner4.jpg',0,'attachment','image/jpeg',0),(38,1,'2024-02-25 16:58:59','2024-02-25 13:58:59','<!-- wp:paragraph -->\n<p>Группа компаний МЕДСИ&nbsp;– это ведущая федеральная сеть частных клиник. В&nbsp;центрах компетенций осуществляется качественная диагностика на&nbsp;экспертном оборудовании, проводятся амбулаторные приемы. Специалисты МЕДСИ выполняют сложнейшие операции и&nbsp;обеспечивают реабилитацию.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В&nbsp;клиниках в&nbsp;Москве, Московской области и&nbsp;регионах, медицинском велнесе и&nbsp;в&nbsp;службе помощи на&nbsp;дому работают высококвалифицированные специалисты, в&nbsp;том числе кандидаты и&nbsp;доктора медицинских наук.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Медицина компетенций МЕДСИ гармонично сочетает опыт и&nbsp;авторские методики с&nbsp;достижениями науки, инновационными технологиями и&nbsp;высоким потенциалом оборудования. Наши пациенты получают высококачественную медицинскую помощь, соответствующую мировым стандартам, и&nbsp;безупречный уровень сервиса.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Мы&nbsp;обеспечили удобный график работы центров компетенций, отсутствие очередей и&nbsp;внимательное, индивидуальное отношение персонала. МЕДСИ формирует ответственное отношение к&nbsp;здоровью, новые традиции обслуживания и&nbsp;единое национальное&nbsp;бизнес-пространство&nbsp;в&nbsp;сфере медицины.</p>\n<!-- /wp:paragraph -->','Сеть клиник МЕДСИ','','inherit','closed','closed','','36-revision-v1','','','2024-02-25 16:58:59','2024-02-25 13:58:59','',36,'https://doveriemsk.ru/?p=38',0,'revision','',0),(39,1,'2024-02-25 17:03:53','2024-02-25 14:03:53','<!-- wp:paragraph -->\n<p><strong>Реабилитационный центр «Преодоление»&nbsp;</strong>— первый&nbsp;в России специализированный круглосуточный стационар европейского уровня для пациентов с тяжелыми ограничениями в передвижении и самообслуживании вследствие повреждения спинного мозга, инсульта, ЧМТ, ДЦП, рассеянного склероза, после ортопедических или травматологических операций.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Сочетание инновационных методик реабилитации, высокого профессионализма специалистов с уникальным опытом работы, новейшего оборудования и раннего начала реабилитации пациента делает центр \"Преодоление\" ведущим в России по восстановлению больных с различными неврологическими заболеваниями и травмами.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Центр открыт в 2007 году при участии Правительства города Москва</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Стационар центра рассчитан на единовременное круглосуточное пребывание 70 пациентов</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2010 году открыто амбулаторно-поликлиническое отделение центра</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2012 году организованы выездные мультидисциплинарные бригады</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2015 году открыт дневной стационар</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Реабилитационно-восстановительный центр «Преодоление»','','publish','open','open','','reabilitaczionno-vosstanovitelnyj-czentr-preodolenie','','','2024-02-25 17:03:56','2024-02-25 14:03:56','',0,'https://doveriemsk.ru/?p=39',0,'post','',0),(40,1,'2024-02-25 17:02:35','2024-02-25 14:02:35','','partner5','','inherit','open','closed','','partner5','','','2024-02-25 17:02:42','2024-02-25 14:02:42','',39,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner5.jpg',0,'attachment','image/jpeg',0),(41,1,'2024-02-25 17:03:53','2024-02-25 14:03:53','<!-- wp:paragraph -->\n<p><strong>Реабилитационный центр «Преодоление»&nbsp;</strong>— первый&nbsp;в России специализированный круглосуточный стационар европейского уровня для пациентов с тяжелыми ограничениями в передвижении и самообслуживании вследствие повреждения спинного мозга, инсульта, ЧМТ, ДЦП, рассеянного склероза, после ортопедических или травматологических операций.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Сочетание инновационных методик реабилитации, высокого профессионализма специалистов с уникальным опытом работы, новейшего оборудования и раннего начала реабилитации пациента делает центр \"Преодоление\" ведущим в России по восстановлению больных с различными неврологическими заболеваниями и травмами.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Центр открыт в 2007 году при участии Правительства города Москва</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Стационар центра рассчитан на единовременное круглосуточное пребывание 70 пациентов</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2010 году открыто амбулаторно-поликлиническое отделение центра</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2012 году организованы выездные мультидисциплинарные бригады</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>В 2015 году открыт дневной стационар</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->','Реабилитационно-восстановительный центр «Преодоление»','','inherit','closed','closed','','39-revision-v1','','','2024-02-25 17:03:53','2024-02-25 14:03:53','',39,'https://doveriemsk.ru/?p=41',0,'revision','',0),(42,1,'2024-02-25 17:08:55','2024-02-25 14:08:55','<!-- wp:paragraph -->\n<p><strong>Основная задача Центра</strong>&nbsp;– проведение комплексной абилитации и реабилитации (медицинской, психолого-педагогической, социальной, профессиональной) инвалидов (детей-инвалидов) и лиц с ограничением жизнедеятельности вследствие нарушений функции движения, профилактика инвалидности молодых людей, имеющих ограничение жизнедеятельности, повышение качества их жизни, активная социализация и интеграция в социум.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В целях обеспечения преемственности и непрерывности процесса медицинской реабилитации детей и молодых инвалидов созданы:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>отделение ранней помощи</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>отделения медико-социальной реабилитации детей в стационарной и нестационарной формах</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>сектор мобильной службы реабилитации, оказывающий реабилитационные услуги детям-инвалидам по территориальному признаку</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>отделения медико-социальной реабилитации лиц старше 18 лет (стационарная, нестационарная форма) и мобильная служба реабилитации лиц старше 18 лет</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Это позволяет осуществлять проведение реабилитационных мероприятий с раннего возраста в целях профилактики инвалидизации и повышения реабилитационного потенциала.</p>\n<!-- /wp:paragraph -->','Научно-практический центр медико-социальной реабилитации инвалидов им. Л.И. Швецовой','','publish','open','open','','nauchno-prakticheskij-czentr-mediko-soczialnoj-reabilitaczii-invalidov-im-l-i-shveczovoj','','','2024-02-25 17:08:58','2024-02-25 14:08:58','',0,'https://doveriemsk.ru/?p=42',0,'post','',0),(43,1,'2024-02-25 17:08:46','2024-02-25 14:08:46','','partner6','','inherit','open','closed','','partner6','','','2024-02-25 17:08:46','2024-02-25 14:08:46','',42,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner6.jpg',0,'attachment','image/jpeg',0),(44,1,'2024-02-25 17:08:55','2024-02-25 14:08:55','<!-- wp:paragraph -->\n<p><strong>Основная задача Центра</strong>&nbsp;– проведение комплексной абилитации и реабилитации (медицинской, психолого-педагогической, социальной, профессиональной) инвалидов (детей-инвалидов) и лиц с ограничением жизнедеятельности вследствие нарушений функции движения, профилактика инвалидности молодых людей, имеющих ограничение жизнедеятельности, повышение качества их жизни, активная социализация и интеграция в социум.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В целях обеспечения преемственности и непрерывности процесса медицинской реабилитации детей и молодых инвалидов созданы:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>отделение ранней помощи</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>отделения медико-социальной реабилитации детей в стационарной и нестационарной формах</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>сектор мобильной службы реабилитации, оказывающий реабилитационные услуги детям-инвалидам по территориальному признаку</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>отделения медико-социальной реабилитации лиц старше 18 лет (стационарная, нестационарная форма) и мобильная служба реабилитации лиц старше 18 лет</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Это позволяет осуществлять проведение реабилитационных мероприятий с раннего возраста в целях профилактики инвалидизации и повышения реабилитационного потенциала.</p>\n<!-- /wp:paragraph -->','Научно-практический центр медико-социальной реабилитации инвалидов им. Л.И. Швецовой','','inherit','closed','closed','','42-revision-v1','','','2024-02-25 17:08:55','2024-02-25 14:08:55','',42,'https://doveriemsk.ru/?p=44',0,'revision','',0),(45,1,'2024-02-25 17:14:33','2024-02-25 14:14:33','<!-- wp:paragraph -->\n<p>Мы занимаемся реабилитацией детей и взрослых после тяжёлых травм, инсультов, операций, помогаем пациентам с болезнью Паркинсона и ДЦП. Наш центр соблюдает принципы доказательной медицины и работает по международным стандартам реабилитации. Мы не боимся тяжёлых пациентов и пытаемся помочь, когда другие центры отказали.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Реабилитационный центр – это место, после которого пациент окажется дома. Наша задача — научить человека пользоваться его привычной средой. Поэтому мы построили тренажёр Easy Street». Это имитация улицы, где есть подъезд, почта, магазин, такси, светофор и пешеходный переход. Говорят, похоже на кинопавильон</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Реабилитационный центр \"Три сестры\"','','publish','open','open','','reabilitaczionnyj-czentr-tri-sestry','','','2024-02-25 17:14:36','2024-02-25 14:14:36','',0,'https://doveriemsk.ru/?p=45',0,'post','',0),(46,1,'2024-02-25 17:13:59','2024-02-25 14:13:59','','partner7','','inherit','open','closed','','partner7','','','2024-02-25 17:13:59','2024-02-25 14:13:59','',45,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner7.jpg',0,'attachment','image/jpeg',0),(47,1,'2024-02-25 17:14:33','2024-02-25 14:14:33','<!-- wp:paragraph -->\n<p>Мы занимаемся реабилитацией детей и взрослых после тяжёлых травм, инсультов, операций, помогаем пациентам с болезнью Паркинсона и ДЦП. Наш центр соблюдает принципы доказательной медицины и работает по международным стандартам реабилитации. Мы не боимся тяжёлых пациентов и пытаемся помочь, когда другие центры отказали.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Реабилитационный центр – это место, после которого пациент окажется дома. Наша задача — научить человека пользоваться его привычной средой. Поэтому мы построили тренажёр Easy Street». Это имитация улицы, где есть подъезд, почта, магазин, такси, светофор и пешеходный переход. Говорят, похоже на кинопавильон</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Реабилитационный центр \"Три сестры\"','','inherit','closed','closed','','45-revision-v1','','','2024-02-25 17:14:33','2024-02-25 14:14:33','',45,'https://doveriemsk.ru/?p=47',0,'revision','',0),(48,1,'2024-02-25 17:20:34','2024-02-25 14:20:34','<!-- wp:paragraph -->\n<p>Городская клиническая больница им. М.Е. Жадкевича&nbsp;была основана в 1893 году и за прошедшие годы приобрела репутацию одного из лучших учреждений московского здравоохранения. Сегодня это одна из крупнейших медицинских организаций в Москве. Круглосуточная КТ, МРТ, ангиография, сложная эндоскопическая, хирургическая и ультразвуковая техника позволяют без малейшего промедления проводить полноценную диагностику.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":49,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://doveriemsk.ru/wp-content/uploads/2024/02/image.gif\" alt=\"\" class=\"wp-image-49\" title=\"history__jpg-1 (2)-min.jpg\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Конечно, насыщенность медицинским оборудованием – это не гарантия правильной лечебно-диагностической работы, это просто её необходимое условие, гарантия – это наши врачи и тут нам есть чем гордиться. В нашей команде – лучшие практические врачи города Москвы. Кто-то проработал в нашей больнице без перерыва долгие годы, кто-то вернулся из частной медицины, кто-то из научных учреждений. В команду подобрались небезразличные люди, которым показалось увлекательным превратить городскую больницу в первоклассный медицинский центр. И они с успехом это делают!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В нашей больнице сегодня сконцентрированы многие виды высокотехнологичной и специальной медицинской помощи, куда направляются пациенты из многих других лечебных учреждений: инвазивная кардиология, сосудистая и эндоскопическая хирургия, ортопедическая травматология, уникальная микрохирургия, сосудистая и общая неврология, гинекология, ЛОР, эндокринология и многие, многие другие. Символично, что наша больница носит имя практического врача, который всю жизнь провёл в операционной и разработал множество уникальных хирургических методик!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>На территории Городской клинической больницы им. М.Е. Жадкевича расположена вертолетная площадка, предназначенная для экстренной доставки пострадавших при ДТП или чрезвычайных происшествиях и доставки пациентов из регионов без соответствующих условий.</p>\n<!-- /wp:paragraph -->','Городская клиническая больница им. М.Е. Жадкевича','','publish','open','open','','gorodskaya-klinicheskaya-bolnicza-im-m-e-zhadkevicha','','','2024-02-25 17:20:36','2024-02-25 14:20:36','',0,'https://doveriemsk.ru/?p=48',0,'post','',0),(49,1,'2024-02-25 17:18:11','2024-02-25 14:18:11','','image','','inherit','open','closed','','image','','','2024-02-25 17:18:11','2024-02-25 14:18:11','',48,'https://doveriemsk.ru/wp-content/uploads/2024/02/image.gif',0,'attachment','image/gif',0),(50,1,'2024-02-25 17:20:27','2024-02-25 14:20:27','','partner8','','inherit','open','closed','','partner8','','','2024-02-25 17:20:27','2024-02-25 14:20:27','',48,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner8.jpg',0,'attachment','image/jpeg',0),(51,1,'2024-02-25 17:20:34','2024-02-25 14:20:34','<!-- wp:paragraph -->\n<p>Городская клиническая больница им. М.Е. Жадкевича&nbsp;была основана в 1893 году и за прошедшие годы приобрела репутацию одного из лучших учреждений московского здравоохранения. Сегодня это одна из крупнейших медицинских организаций в Москве. Круглосуточная КТ, МРТ, ангиография, сложная эндоскопическая, хирургическая и ультразвуковая техника позволяют без малейшего промедления проводить полноценную диагностику.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":49,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://doveriemsk.ru/wp-content/uploads/2024/02/image.gif\" alt=\"\" class=\"wp-image-49\" title=\"history__jpg-1 (2)-min.jpg\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Конечно, насыщенность медицинским оборудованием – это не гарантия правильной лечебно-диагностической работы, это просто её необходимое условие, гарантия – это наши врачи и тут нам есть чем гордиться. В нашей команде – лучшие практические врачи города Москвы. Кто-то проработал в нашей больнице без перерыва долгие годы, кто-то вернулся из частной медицины, кто-то из научных учреждений. В команду подобрались небезразличные люди, которым показалось увлекательным превратить городскую больницу в первоклассный медицинский центр. И они с успехом это делают!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В нашей больнице сегодня сконцентрированы многие виды высокотехнологичной и специальной медицинской помощи, куда направляются пациенты из многих других лечебных учреждений: инвазивная кардиология, сосудистая и эндоскопическая хирургия, ортопедическая травматология, уникальная микрохирургия, сосудистая и общая неврология, гинекология, ЛОР, эндокринология и многие, многие другие. Символично, что наша больница носит имя практического врача, который всю жизнь провёл в операционной и разработал множество уникальных хирургических методик!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>На территории Городской клинической больницы им. М.Е. Жадкевича расположена вертолетная площадка, предназначенная для экстренной доставки пострадавших при ДТП или чрезвычайных происшествиях и доставки пациентов из регионов без соответствующих условий.</p>\n<!-- /wp:paragraph -->','Городская клиническая больница им. М.Е. Жадкевича','','inherit','closed','closed','','48-revision-v1','','','2024-02-25 17:20:34','2024-02-25 14:20:34','',48,'https://doveriemsk.ru/?p=51',0,'revision','',0),(52,1,'2024-02-25 17:26:07','2024-02-25 14:26:07','<!-- wp:paragraph -->\n<p>Государственное бюджетное учреждение здравоохранения «Жуковская областная клиническая больница» представляет собой мощный многопрофильный лечебно-диагностический комплекс, включающий в себя стационар и амбулаторно-поликлинические подразделения: городская поликлиника, 3 филиала детской поликлиники, Центр восстановительной медицины и реабилитации, женская консультация. Наше лечебное учреждение оказывает помощь не только жителям города, но и жителям других территорий Московской области.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>На базе ГБУЗ МО «Жуковская ОКБ» функционирует областной кардиологический центр. Стационар больницы включает в себя три отделения областного уровня: кардиологическое, урологическое, челюстно-лицевой хирургии. В прошедшем году открыто специализированное отделение сосудистой хирургии, где проводятся уникальные операции. С 2010 года ГБУЗ МО «Жуковская ОКБ», одно из первых в Московской области, перешло на оплату стационарной помощи по медико-экономическим стандартам.</p>\n<!-- /wp:paragraph -->','Областная Клиническая Больница г.о. Жуковский','','publish','open','open','','oblastnaya-klinicheskaya-bolnicza-g-o-zhukovskij','','','2024-02-25 17:26:09','2024-02-25 14:26:09','',0,'https://doveriemsk.ru/?p=52',0,'post','',0),(53,1,'2024-02-25 17:25:57','2024-02-25 14:25:57','','partner9','','inherit','open','closed','','partner9','','','2024-02-25 17:25:57','2024-02-25 14:25:57','',52,'https://doveriemsk.ru/wp-content/uploads/2024/02/partner9.jpg',0,'attachment','image/jpeg',0),(54,1,'2024-02-25 17:26:07','2024-02-25 14:26:07','<!-- wp:paragraph -->\n<p>Государст